import React from "react";
import { useDispatch } from "react-redux";


const Cart = () => {
    const dispatch = useDispatch();

    dispatch({
        type: "Header",
        payload: {
            name: "Cart",
            title: "Hooray! We Have your supplements ready",
        },
    });

    return <section>Cart</section>;
};

export default Cart;
